import React from 'react'

const Todo = ({task}) => {
    return (
        <div className="Todo">
                <input type="checkbox" onClick={() => toggleComplete(task.id)} className={`${task.completed ? 'completed' : ""}`} />
                <label for="task">{task.task}
                    <button type="button">edit</button>
                    <button type="button">delete</button>
                </label>
        </div>
    )
}


export default Todo
